const DashboardPage = () =>{
const navigate = useNavigate();
const handleMenuCLick = () =>{
    navigate("/menu")
};
    return(<>
            <h1>To menu</h1>
            <button className="btn btn-primary w-100" onClick={handleMenuCLick}>Menu</button>
    </>

    );
}

export default DashboardPage;
